import React, { useState, useEffect } from 'react';
import { View, Text, StyleSheet, TouchableOpacity, Modal, TextInput, Button } from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome';
import { useNavigation } from '@react-navigation/native';

export default function Seller() {
  const navigation = useNavigation();
  const [isModalVisible, setModalVisible] = useState(false);
  const [fastFoodName, setFastFoodName] = useState('');
  const [fastFoodMenu, setFastFoodMenu] = useState('');
  const [fastFoodPrice, setFastFoodPrice] = useState('');
  const [menuList, setMenuList] = useState([]);
  const [scaleValue] = useState(new Animated.Value(1));

  useEffect(() => {
    loadMenuFromStorage();
  }, []);

  const toggleModal = () => {
    setModalVisible(!isModalVisible);
  };

  const handlePostMenu = () => {
    const newItem = {
      fastFoodName,
      fastFoodMenu,
      fastFoodPrice,
    };

    const updatedMenuList = [...menuList, newItem];
    setMenuList(updatedMenuList);

    saveMenuToStorage(updatedMenuList);

    setFastFoodName('');
    setFastFoodMenu('');
    setFastFoodPrice('');

    toggleModal();
  };

  const loadMenuFromStorage = () => {
    const savedMenu = localStorage.getItem('menu');
    if (savedMenu) {
      const parsedMenu = JSON.parse(savedMenu);
      setMenuList(parsedMenu);
    }
  };

  const saveMenuToStorage = (menu) => {
    localStorage.setItem('menu', JSON.stringify(menu));
  };

  return (
    <View style={styles.container}>
      <TouchableOpacity
        onPress={() => navigation.goBack()}
        style={styles.backButton}
      >
        <Icon name="arrow-left" size={24} color="black" />
      </TouchableOpacity>

      <Text style={styles.sectionTitle}>Seller</Text>

      <TouchableOpacity onPress={toggleModal} style={styles.button}>
        <Text style={styles.buttonText}>Post Fast Food Menu</Text>
      </TouchableOpacity>

      <Modal
        animationType="slide"
        transparent={true}
        visible={isModalVisible}
      >
        <View style={styles.modalContainer}>
          <Text style={styles.modalTitle}>Post Fast Food Menu</Text>
          <TextInput
            placeholder="Fast Food Name"
            onChangeText={(text) => setFastFoodName(text)}
            value={fastFoodName}
            style={styles.input}
          />
          <TextInput
            placeholder="Fast Food Menu"
            onChangeText={(text) => setFastFoodMenu(text)}
            value={fastFoodMenu}
            style={styles.input}
          />
          <TextInput
            placeholder="Fast Food Price"
            onChangeText={(text) => setFastFoodPrice(text)}
            value={fastFoodPrice}
            style={styles.input}
          />
          <Button title="Post Menu" onPress={handlePostMenu} />
          <Button title="Close" onPress={toggleModal} />
        </View>
      </Modal>

      <View style={styles.menuContainer}>
        {menuList.map((menuItem, index) => (
          <TouchableOpacity
            key={index}
            onPress={() => handlePress('Seller', menuItem.fastFoodName)}
            style={styles.brandButton}
          >
            <View>
              <Text style={styles.brandButtonText1}>{menuItem.fastFoodName}</Text>
            </View>
            <Icon name="arrow-right" size={30} color="#007BFF" />
          </TouchableOpacity>
        ))}
      </View>
    </View>
  );
}




const styles = StyleSheet.create({
  container: {
    flex: 1,
    marginTop: 19,
    paddingHorizontal: 20,
    justifyContent: 'center',
  },
  sectionTitle: {
    fontSize: 24,
    fontWeight: 'bold',
  },
  backButton: {
    position: 'absolute',
    left: 20,
    top: 20,
  },
  button: {
    marginTop: 20,
    backgroundColor: 'blue',
    padding: 10,
    borderRadius: 5,
  },
  buttonText: {
    color: 'white',
    textAlign: 'center',
  },
  modalContainer: {
    flex: 1,
    justifyContent: 'center',
    paddingHorizontal: 20,
  },
  modalTitle: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  input: {
    height: 40,
    borderColor: 'gray',
    borderWidth: 1,
    marginBottom: 10,
    paddingHorizontal: 10,
  },
});
